import React, { Component } from "react";
import { Link } from "react-router-dom";

class SearchResults extends Component {
  renderResults(results) {
    if (!results) console.log("results variable is undefined");
    else if (results.length === 0) return <p>No results</p>;
    else
      return (
        <div className="results-container">
          <ul className="results-list">
            {results.slice(0, 10).map((result, index) => (
              <Link key={index} to={`/find/${result[2]}`}>
                {result[0]}, {result[1]}
              </Link>
            ))}
          </ul>
          <div className="close.btn">
            <img
              src={process.env.PUBLIC_URL + "/img/close-btn.png"}
              placeholder="close"
              alt="close"
            />
          </div>
        </div>
      );
  }
  render() {
    const { searchResults } = this.props;
    return (
      <div className="search-results">{this.renderResults(searchResults)}</div>
    );
  }
}

export default SearchResults;
